Title: GREAT SHOW.....WHY IS PRICE HIGHER THAN OTHER CBS SHOWS ? Review: The series was a wonderful show and I would give it a five star. I agree it did not get a fair shake, just like SHARK of a few years ago. Same network. Now it appears that the boys at CBS are just as unfair to the fans regarding the DVD release. I guess CBS feels that it is only right to make the fans of this show suffer more by paying more for this series than other CBS releases on DVD. They are charging 30% for this release and for fewer episodes. I see that Blue Bloods and Hawaii ZERO (sorry Five O - I was thinking of quality) are priced at $ 38 while Defenders is $ 50. I am certain when it is all said and done the same network know nothings who said it was a ratings decision will somehow justify their lack of intelligence by saying "you see...the DVDs did not sell either". They will not mention that they overpriced the product to get that result. Is this product review negative?
Options: 1. Yes; 2. No;
Answer:

